        const post_form = new FormData
        for (let dt in form_data){
            post_form.append(dt , form_data[dt])
        }
        let s_code ;
        fetch(
            APIBASE_URL,
            {
                method : 'POST',
                body : post_form
            }
        )
        .then(response =>{
            s_code = response.status
            if (response.ok){
                return response.json()
            }
        })
